   patch -f ${1} ${BASEDIR}/${2}
   ExitCodeCheck $?
   if [[ -n "${3}" ]]; then
      chmod ${3} ${1}
      ExitCodeCheck $?
   fi
   rm -f ${BASEDIR}/${2}
   ExitCodeCheck $?
}

