configure_settings(){
   if [ -f ${SETTINGS_SAVE} ]; then
      echo '################################'
      echo 'RESTORE SETTINGS'
      echo '################################'
   else
      echo '################################'
      echo 'CONFIGURE SETTINGS'
      echo '################################'
   fi

   rtcm_msg="1005(10),1033(10),1077,1087,1097,1107,1117,1127,1137,1230(30)"
   rtcm_msg_onocoy="1005(30),1033(30),1077,1087,1097,1107,1117,1127,1137,1230(30)"
   rtcm_msg_rtkgo="1005(10),1077,1087,1097,1107,1117,1127,1137,1230(30)"

   sed="sudo -u ${RTKBASE_USER} sed -i"
   #echo sed=${sed}

   POINTED_VERSION=`echo ${NEW_VERSION} | sed 's/^\(.\)\(.\)\(.\)/\1.\2.\3/'`
   #echo POINTED_VERSION=${POINTED_VERSION}
   ${sed} s/^elt_version=.*/elt_version=${POINTED_VERSION}/ "${SETTINGS_DEFAULT}"

   if [ -f ${SETTINGS_SAVE} ]; then
      #echo sudo -u "${RTKBASE_USER}" mv ${SETTINGS_SAVE} ${SETTINGS_NOW}
      sudo -u "${RTKBASE_USER}" mv ${SETTINGS_SAVE} ${SETTINGS_NOW}
      ExitCodeCheck $?

      if [[ ${OLD_VERSION} < 172 ]]; then
         source <( grep -v '^#' "${SETTINGS_NOW}" | grep 'rtcm_msg_a=' )
         #echo rtcm_msg_a=${rtcm_msg_a}
         if [[ "${rtcm_msg_a}" == "${rtcm_msg}" ]]; then
            echo correct \"rtcm_msg_a\" field for version below 172
            ${sed} s/^rtcm_msg_a=.*/rtcm_msg_a=\'${rtcm_msg_onocoy}\'/ "${SETTINGS_NOW}"
         fi
      fi

      source <( grep -v '^#' "${SETTINGS_DEFAULT}" | grep 'version=' )
      #echo version=${version} VERSION_FILE=${VERSION_FILE}
      ${sed} s/^version=.*/version=${version}/ "${SETTINGS_NOW}"

      #echo if grep -q \"^elt_version=\" \"${SETTINGS_NOW}\"\; then
      if grep -q "^elt_version=" "${SETTINGS_NOW}"; then
         #echo ${sed} \"s/^elt_version=.*/elt_version=${NEW_VERSION}/\" \"${SETTINGS_NOW}\"
         ${sed} "s/^elt_version=.*/elt_version=${POINTED_VERSION}/" "${SETTINGS_NOW}"
      else
         echo insert elt_version into ${SETTINGS_NOW}
         #echo ${sed} "\"/^version=/a # ELT Version\\nelt_version=${NEW_VERSION}\"" \"${SETTINGS_NOW}\"
         ${sed} "/^version=/a # ELT Version\nelt_version=${POINTED_VERSION}" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^cast2=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^cast2=" "${SETTINGS_NOW}"; then
         echo insert cast2 into ${SETTINGS_NOW}
         #echo ${sed} "\"/^cast=/a cast2=/usr/local/bin/ntripserver\"" \"${SETTINGS_NOW}\"
         ${sed} "/^cast=/a cast2=/usr/local/bin/ntripserver" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^svr_mode_a=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^svr_mode_a=" "${SETTINGS_NOW}"; then
         echo insert svr_mode_a and svr_login_a into ${SETTINGS_NOW}
         #echo ${sed} "\"/^svr_port_a=/a #ntrip A caster mode]\\nsvr_mode_a=\'0\'\\n#ntrip A caster login\\nsvr_login_a=\'\'\"" \"${SETTINGS_NOW}\"
         ${sed} "/^svr_port_a=/a #ntrip A caster mode\nsvr_mode_a=\'0\'\n#ntrip A caster login\nsvr_login_a=\'\'" "${SETTINGS_NOW}"
         source <( grep -v '^#' "${SETTINGS_NOW}" | grep 'svr_addr_a=' )
         #echo svr_addr_a=${svr_addr_a}
         if [[ "${svr_addr_a}" == "servers.onocoy.com" ]]; then
            source <( grep -v '^#' "${SETTINGS_NOW}" | grep 'mnt_name_a=' )
            echo replace svr_login_a as mnt_name_a for ${mnt_name_a}
            ${sed} s/^svr_login_a=.*/svr_login_a=${mnt_name_a}/ "${SETTINGS_NOW}"
            ${sed} s/^mnt_name_a=.*/mnt_name_a=/ "${SETTINGS_NOW}"
         fi
      fi

      #echo if ! grep -q \"^svr_mode_b=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^svr_mode_b=" "${SETTINGS_NOW}"; then
         echo insert svr_mode_b and svr_login_b into ${SETTINGS_NOW}
         #echo ${sed} "\"/^svr_port_b=/a #ntrip B caster mode]\\nsvr_mode_b=\'0\'\\n#ntrip B caster login\\nsvr_login_b=\'\'\"" \"${SETTINGS_NOW}\"
         ${sed} "/^svr_port_b=/a #ntrip B caster mode\nsvr_mode_b=\'0\'\n#ntrip B caster login\nsvr_login_b=\'\'" "${SETTINGS_NOW}"
         source <( grep -v '^#' "${SETTINGS_NOW}" | grep 'svr_addr_b=' )
         #echo svr_addr_b=${svr_addr_b}
         if [[ "${svr_addr_b}" == "servers.onocoy.com" ]]; then
            source <( grep -v '^#' "${SETTINGS_NOW}" | grep 'mnt_name_b=' )
            echo replace svr_login_b as mnt_name_b for ${mnt_name_b}
            ${sed} s/^svr_login_b=.*/svr_login_b=${mnt_name_b}/ "${SETTINGS_NOW}"
            ${sed} s/^mnt_name_b=.*/mnt_name_b=/ "${SETTINGS_NOW}"
         fi
      fi

      #echo if ! grep -q \"^\[ntrip_E\]=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^\[ntrip_E\]" "${SETTINGS_NOW}"; then
         echo insert [ntrip_E] into ${SETTINGS_NOW}
         ${sed} "/^ntrip_b_receiver_options=/a \ \n[ntrip_E]\n\n# NTRIP E caster options\n\n#ntrip E caster url\nsvr_addr_e=\'crtk\.net\'\n#ntrip E caster port\nsvr_port_e=\'2101\'\n#ntrip E caster mode\nsvr_mode_e=\'2\'\n#ntrip E caster login\nsvr_login_e=\'centipede\'\n#ntrip E caster password\nsvr_pwd_e=\'centipede\'\n#Mount name\nmnt_name_e=\'\'\nrtcm_msg_e=\'${rtcm_msg}\'\n#Receiver dependent options\nntrip_e_receiver_options=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^\[ntrip_D\]=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^\[ntrip_D\]" "${SETTINGS_NOW}"; then
         echo insert [ntrip_D] into ${SETTINGS_NOW}
         ${sed} "/^ntrip_b_receiver_options=/a \ \n[ntrip_D]\n\n# NTRIP D caster options\n\n#ntrip D caster url\nsvr_addr_d=\'caster\.emlid\.com\'\n#ntrip D caster port\nsvr_port_d=\'2101\'\n#ntrip D caster mode\nsvr_mode_d=\'0\'\n#ntrip D caster login\nsvr_login_d=\'\'\n#ntrip D caster password\nsvr_pwd_d=\'\'\n#Mount name\nmnt_name_d=\'\'\nrtcm_msg_d=\'${rtcm_msg}\'\n#Receiver dependent options\nntrip_d_receiver_options=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^\[ntrip_C\]=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^\[ntrip_C\]" "${SETTINGS_NOW}"; then
         echo insert [ntrip_C] into ${SETTINGS_NOW}
         ${sed} "/^ntrip_b_receiver_options=/a \ \n[ntrip_C]\n\n# NTRIP C caster options\n\n#ntrip C caster url\nsvr_addr_c=\'rtk2go\.com\'\n#ntrip C caster port\nsvr_port_c=\'2101\'\n#ntrip C caster mode\nsvr_mode_c=\'0\'\n#ntrip C caster login\nsvr_login_c=\'\'\n#ntrip C caster password\nsvr_pwd_c=\'\'\n#Mount name\nmnt_name_c=\'\'\nrtcm_msg_c=\'${rtcm_msg_rtkgo}\'\n#Receiver dependent options\nntrip_c_receiver_options=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q "^mobile_modem_web_ip=" "${SETTINGS_NOW}"; then
      if ! grep -q "^mobile_modem_web_ip=" "${SETTINGS_NOW}"; then
         echo insert mobile_modem_web_ip and mobile_modem_web_proxy_port into ${SETTINGS_NOW}
         #echo ${sed} "/^gnss_rcv_web_proxy_port=/a #ip address of the integrated modem web service (ie on E3372-325)\nmobile_modem_web_ip=192.168.8.1\n#port number for the Flask proxy app used to display the modem web service\nmobile_modem_web_proxy_port=7070" "${SETTINGS_NOW}"
         ${sed} "/^gnss_rcv_web_proxy_port=/a #ip address of the integrated modem web service (ie on E3372-325)\nmobile_modem_web_ip=192.168.8.1\n#port number for the Flask proxy app used to display the modem web service\nmobile_modem_web_proxy_port=7070" "${SETTINGS_NOW}"
         ExitCodeCheck $?
      fi

      #if ! grep -q "^receiver_inactivity_timeout=" "${SETTINGS_NOW}"; then
      if ! grep -q "^receiver_inactivity_timeout=" "${SETTINGS_NOW}"; then
         echo insert receiver_inactivity_timeout into ${SETTINGS_NOW}
         #echo ${sed} "/^gnss_rcv_web_proxy_port=/a #gnss receiver inactivity timeout in seconds\nreceiver_inactivity_timeout=\'60\'" "${SETTINGS_NOW}"
         ${sed} "/^receiver_carrier=/a #gnss receiver inactivity timeout in seconds\nreceiver_inactivity_timeout=\'60\'" "${SETTINGS_NOW}"
         ExitCodeCheck $?
      fi
   else
      #echo cp ${SETTINGS_DEFAULT} ${SETTINGS_NOW}
      cp ${SETTINGS_DEFAULT} ${SETTINGS_NOW}
      ExitCodeCheck $?

      #echo chown ${RTKBASE_USER}:${RTKBASE_USER} ${SETTINGS_NOW}
      chown ${RTKBASE_USER}:${RTKBASE_USER} ${SETTINGS_NOW}
      ExitCodeCheck $?
   fi
}

configure_gnss(){
   UP_TIME=`cat /proc/uptime | sed "s/\..*$//"`
   LIMIT_TIME=40
   LEFT_TIME=`expr ${LIMIT_TIME} - ${UP_TIME}`
   #echo UP_TIME=${UP_TIME} LIMIT_TIME=${LIMIT_TIME} LEFT_TIME=${LEFT_TIME}
   if [[ ${LEFT_TIME} -gt 0 ]]; then
      #echo sleep ${LEFT_TIME}
      sleep ${LEFT_TIME}
   fi

   rtkbase_path=${RTKBASE_GIT}
   #echo source "${OPIZERO_TEMP}"
   source "${OPIZERO_TEMP}"
   ExitCodeCheck $?

   HAVE_TTYUSB=`find /dev/ttyUSB* 2>/dev/null`
   HAVE_TTYACM=`find /dev/ttyACM* 2>/dev/null`
   HAVE_TTYAMA=`find /dev/ttyAMA* 2>/dev/null`
   #echo HAVE_TTYUSB=${HAVE_TTYUSB} HAVE_TTYACM=${HAVE_TTYACM} HAVE_TTYAMA=${HAVE_TTYAMA} RECVPORT=${RECVPORT}
   if [[ "${HAVE_TTYUSB}" == "" ]] && [[ "${HAVE_TTYACM}" == "" ]] && [[ "${HAVE_TTYAMA}" == "" ]] && [[ ! -c "${RECVPORT}" ]]; then
      NO_START_MAIN_SERVICE=YES
      echo 'No any ports for GNSS receiver. We can'\''t detect and configure.'
      ExitCodeCheck 1
   else
      if [[ "${UPDATE}" != "Y" ]] || ! have_full; then
         for i in `seq 1 3`; do
            #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -e -s
            ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -e -s 2>&1
            ExitCodeCheck $?
            if [[ $lastcode == 0 ]]; then
               break;
            fi
         done
         if [[ $lastcode != 0 ]]; then
            NO_START_MAIN_SERVICE=YES
         fi
      fi

      if [[ ${OLD_VERSION} < 193 ]] || ! have_full; then
         source <( grep '^com_port=' "${SETTINGS_NOW}" ) #import settings
         if [[ "${com_port}" == "" ]]; then
            NO_START_MAIN_SERVICE=YES
            echo 'GNSS receiver is not specified. We can'\''t configure.'
            if [[ "${ONLINE_UPDATE}" != "UPDATE" ]]; then
               ExitCodeCheck 1
            fi
         else
            for i in `seq 1 3`; do
               #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c -s
               ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c -s 2>&1
               ExitCodeCheck $?
               if [[ $lastcode == 0 ]]; then
                  GNSS_CONFIGURED=YES
                  break;
               fi
            done
            if [[ $lastcode != 0 ]]; then
               NO_START_MAIN_SERVICE=YES
            fi
         fi
      fi
   fi

   restart_rtkbase_if_started
}

delete_from_service_list(){
  serviceStartList=${serviceStartList// $1 / }
  serviceStartList=${serviceStartList/#$1 /}
  serviceStartList=${serviceStartList/% $1/}
}

start_rtkbase_services(){
  echo '################################'
  echo 'STARTING SERVICES'
  echo '################################'

  #echo sync
  sync
  ExitCodeCheck $?
  #echo systemctl daemon-reload
  systemctl daemon-reload
  ExitCodeCheck $?

  #echo systemctl enable --now rtkbase_web.service
  systemctl enable --now rtkbase_web.service
  ExitCodeCheck $?
  delete_from_service_list rtkbase_web.service

  #echo systemctl enable --now rtkbase_archive.timer
  systemctl enable --now rtkbase_archive.timer
  ExitCodeCheck $?
  delete_from_service_list rtkbase_archive.timer

  if grep -qE "^modem_at_port='/[[:alnum:]]+.*'" "${SETTINGS_NOW}"; then
     #echo systemctl enable --now modem_check.timer
     systemctl enable --now modem_check.timer
     ExitCodeCheck $?
     delete_from_service_list modem_check.timer
  fi

  source <( grep '^receiver=' "${SETTINGS_NOW}" ) #import settings
  ExitCodeCheck $?
  #echo receiver=${receiver}

  DHCP_enabled=$(systemctl is-enabled "${DHCP_SERVICE}")
  [[ "${DHCP_enabled}" != "disabled" ]] && [[ "${DHCP_enabled}" != "masked" ]] && systemctl disable "${DHCP_SERVICE}"

  GNSS_WEB_PROXY=rtkbase_gnss_web_proxy.service
  RAW2NMEA_SERVICE=rtkbase_raw2nmea.service
  if [[ "${receiver}" =~ Septentrio ]]; then
     #echo systemctl start "${DHCP_SERVICE}"
     systemctl start "${DHCP_SERVICE}"
     ExitCodeCheck $?
     delete_from_service_list ${DHCP_SERVICE}

     #echo systemctl enable --now "${SEPTENTRIO_NAT_SERVICE}"
     systemctl enable --now "${SEPTENTRIO_NAT_SERVICE}"
     ExitCodeCheck $?
     delete_from_service_list ${SEPTENTRIO_NAT_SERVICE}

     #echo systemctl enable --now "${GNSS_WEB_PROXY}"
     systemctl enable --now "${GNSS_WEB_PROXY}"
     ExitCodeCheck $?
     delete_from_service_list ${GNSS_WEB_PROXY}

     if is_ELT07x5; then
        GPSD_CONFIG=/etc/default/gpsd
        CHRONY_CONFIG=/etc/chrony/chrony.conf
        TEMPFILE=/run/gpsd.tmp
        echo source \<\( grep '^nmea_port=' "${SETTINGS_NOW}" \)
        source <( grep '^nmea_port=' "${SETTINGS_NOW}" )
        ExitCodeCheck $?
        #echo sed -i \"s/^DEVICES=.*/DEVICES=\"tcp:\/\/localhost:${nmea_port} \/dev\/pps0\"/\" ${GPSD_CONFIG}
        sed -i "s/^DEVICES=.*/DEVICES=\"tcp:\/\/localhost:${nmea_port} \/dev\/pps0\"/" ${GPSD_CONFIG}
        ExitCodeCheck $?
        #echo sed -i \'s/^refclock SHM .*/refclock SHM 0 refid GNSS precision 1e-1 offset 0 delay 0.2 noselect/\' ${CHRONY_CONFIG}
        sed -i 's/^refclock SHM .*/refclock SHM 0 refid GNSS precision 1e-1 offset 0 delay 0.2 noselect/' ${CHRONY_CONFIG}
        ExitCodeCheck $?
        #echo sed -i \'s/^.\\?refclock PPS .*/refclock PPS /dev/pps0 refid PPS lock GNSS\' ${CHRONY_CONFIG}
        sed -i 's/^.\?refclock PPS .*/refclock PPS \/dev\/pps0 refid PPS lock GNSS/' ${CHRONY_CONFIG}
        ExitCodeCheck $?
        #echo systemctl enable --now "${RAW2NMEA_SERVICE}"
        systemctl enable --now "${RAW2NMEA_SERVICE}"
        ExitCodeCheck $?
        delete_from_service_list ${RAW2NMEA_SERVICE}
     fi
  fi

  if [[ "${ONLINE_UPDATE}" == "UPDATE" ]]; then
     if ! [[ "${serviceStartList}" =~ "str2str_tcp.service" ]]; then
        NO_START_MAIN_SERVICE=YES
     fi
  fi
  if [[ "${NO_START_MAIN_SERVICE}" != "YES" ]]; then
     main_service_key="--now"
  fi
  #echo ONLINE_UPDATE=${ONLINE_UPDATE} NO_START_MAIN_SERVICE=${NO_START_MAIN_SERVICE} main_service_key=${main_service_key} serviceStartList=${serviceStartList}

  #echo systemctl enable ${main_service_key} str2str_tcp.service
  systemctl enable ${main_service_key} str2str_tcp.service
  ExitCodeCheck $?
  delete_from_service_list str2str_tcp.service
  if [[ "${lastcode}" != "0" ]] ; then
     if [[ "${GNSS_CONFIGURED}" != "YES" ]] ; then
        #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c -s
        ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c -s 2>&1
        ExitCodeCheck $?
        #echo lastcode=$lastcode
     fi
     if [[ "${lastcode}" == "0" ]] ; then
        #echo systemctl enable --now str2str_tcp.service
        systemctl enable --now str2str_tcp.service
        ExitCodeCheck $?
        #echo lastcode=$lastcode
        if [[ "${lastcode}" == "0" ]] ; then
           #echo systemctl restart gpsd.service
           systemctl restart gpsd.service
           ExitCodeCheck $?
           delete_from_service_list gpsd.service
           #echo systemctl restart chrony.service
           systemctl restart chrony.service
           ExitCodeCheck $?
           delete_from_service_list chrony.service
        fi
     fi
  fi

  MOBILE=/sys/class/net/mobile
  if [[ -L ${MOBILE} ]]; then
     #echo systemctl enable --now "${MODEM_WEB_PROXY_SERVICE}"
     systemctl enable --now "${MODEM_WEB_PROXY_SERVICE}"
     ExitCodeCheck $?
     delete_from_service_list ${MODEM_WEB_PROXY_SERVICE}
  fi

  #echo systemctl start "${CHECK_INTERNET_SERVICE}"
  systemctl start "${CHECK_INTERNET_SERVICE}"
  ExitCodeCheck $?
  delete_from_service_list ${CHECK_INTERNET_SERVICE}

  HAVE_ELT0x33=`find -P /dev/serial/by-id -name "*ELT0x33*" 2>/dev/null`
  if [[ "${HAVE_ELT0x33}" != "" ]]; then
     #echo systemctl start "${CHECK_SATELITES_SERVICE}"
     systemctl start "${CHECK_SATELITES_SERVICE}"
     ExitCodeCheck $?
     delete_from_service_list ${CHECK_SATELITES_SERVICE}
  fi

  if [[ -n "${serviceStartList}" ]]; then
     #echo serviceStartList=${serviceStartList}
     for service_name in ${serviceStartList}; do
         service_active=$(systemctl is-active "${service_name}")
         if [[ "${service_active}" != "active" ]] && [[ "${service_active}" != "activating" ]]; then
            #echo ${service_name} is ${service_active}
            #echo systemctl start "${service_name}"
            systemctl start "${service_name}"
         fi
     done
  fi
}

delete_garbage(){
   if [[ "${FILES_DELETE}" != "" ]]
   then
      echo '################################'
      echo 'DELETE GARBAGE'
      echo '################################'

      #echo rm -f ${FILES_DELETE}
      rm -f ${FILES_DELETE}
      #echo \[ $exitcode = 0 \] \&\& have_receiver \&\& echo rm -f ${BASENAME}
   fi
   [ $exitcode = 0 ] && have_receiver && rm -f ${BASENAME}
}

info_open(){
   NOW_HOST=`hostname`
   if [ $exitcode = 0 ]
   then
      echo You can open your browser to http://${NOW_HOST}.local into local network
   else
      echo exitcode = $exitcode Check bugs in this output
   fi
}

info_bug(){
   if [ $exitcode != 0 ]
   then
      echo exitcode = $exitcode Check bugs in this output
   fi
}

HAVE_RECEIVER=0
HAVE_PHASE1=0
HAVE_FULL=0
HAVE_RPI=0
CAN_REBOOT=0

have_receiver(){
   return ${HAVE_RECEIVER}
}
have_phase1(){
   return ${HAVE_PHASE1}
}
have_full(){
   return ${HAVE_FULL}
}
have_rpi(){
   return ${HAVE_RPI}
}
can_reboot(){
   return ${CAN_REBOOT}
}

